// Header.js
import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-scroll';
import './Header.css';
import ScrollToTop from './ScrollTop';

const Header = () => {
  return (
    <AppBar position="fixed" className="app-bar" elevation={0} style={{ backgroundColor: 'white', color: 'black', fontWeight: 'bold' }}>
      <Toolbar>
        <ScrollToTop />
        <Typography variant="h6" style={{ flexGrow: 0 }}>
          My Portfolio
        </Typography>
        <Button style={{ marginLeft: '750px' }} component={Link} to="home" smooth={true} duration={500} color="inherit">Home</Button>
        <Button component={Link} to="aboutMe" smooth={true} duration={500} color="inherit">About</Button>
        <Button component={Link} to="projects" smooth={true} duration={500} color="inherit">Projects</Button>
        <Button component={Link} to="contact" smooth={true} duration={500} color="inherit">Contact</Button>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
